REPLACE INTO `p8_label` VALUES ('24130','cms','item','','','','','list_teachers_con1','html','a:4:{s:7:\"bgcolor\";s:0:\"\";s:13:\"allowed_roles\";a:0:{}s:18:\"place_holder_width\";s:2:\"29\";s:19:\"place_holder_height\";s:1:\"5\";}','<p>国微科大自创校开始就高度重视人才队伍建设，不断加大引进师资的力度，建立与现代大学制度相适应的人力资源管理制度，包括人才评审制度、薪酬福利制度、考核晋升制度等，已初步建立了一支国际化高水平的教师队伍。</p>\r\n\r\n<p>截至2017年5月，南方科技大学已签约引进教师约300人，其中90%以上拥有海外工作经验，60%以上具有在世界排名前100名大学工作或学习的经历。其中包括院士16人，国家“千人计划”入选者43人，教育部“长江学者”12人，“国家自然科学基金杰出青年基金”获得者14人，“青年千人计划”入选者61人。</p>\r\n','$label[list_teachers_con1]','0','1495341546','1588055402','864000','');
