REPLACE INTO `p8_label` VALUES ('29578','cms','item','','','','','xxjj_cont03','html','a:4:{s:7:\"bgcolor\";s:0:\"\";s:13:\"allowed_roles\";a:0:{}s:18:\"place_holder_width\";s:2:\"60\";s:19:\"place_holder_height\";s:2:\"20\";}','2001年1月，北京大学与深圳市人民政府签署《合作创办北京大学深圳校区协议书》，共同创办北京大学深圳研究生院。经过十五年发展，深圳研究生院依托北大、立足深圳，逐步成为扎根深圳的北京大学研究型国际化校区，北京大学创建世界一流大学战略的重要组成部分。<br />\r\n<br />\r\n依托北京大学学科优势，结合深圳的区位优势，深圳研究生院以&ldquo;前沿领域、交叉学科、应用学术、国际标准&rdquo;为办学方针，加强学科建设。现有信息工程学院、化学生物学与生物技术学院、环境与能源学院、城市规划与设计学院、新材料学院、汇丰商学院、国际法学院以及人文社会科学学院等八个学院，学科专业涉及信息科学与技术、电子与通讯技术、化学生物学、环境科学、环境与能源、城市与区域规划、景观设计学、社会学、心理学、新闻传播、金融、经济、管理、法律等领域。<br />\r\n<br />\r\n2001年1月，北京大学与深圳市人民政府签署《合作创办北京大学深圳校区协议书》，共同创办北京大学深圳研究生院。经过十五年发展，深圳研究生院依托北大、立足深圳，逐步成为扎根深圳的北京大学研究型国际化校区，北京大学创建世界一流大学战略的重要组成部分。<br />\r\n<br />\r\n依托北京大学学科优势，结合深圳的区位优势，深圳研究生院以&ldquo;前沿领域、交叉学科、应用学术、国际标准&rdquo;为办学方针，加强学科建设。现有信息工程学院、化学生物学与生物技术学院、环境与能源学院、城市规划与设计学院、新材料学院、汇丰商学院、国际法学院以及人文社会科学学院等八个学院，学科专业涉及信息科学与技术、电子与通讯技术、化学生物学、环境科学、环境与能源、城市与区域规划、景观设计学、社会学、心理学、新闻传播、金融、经济、管理、法律等领域。','$label[xxjj_cont03]','0','1501403622','1588055402','300','');
